// Geocode ZIP → city, state, lat, lon
async function geocodeZip(zip) {
  const res = await fetch(`https://api.zippopotam.us/us/${zip}`);
  if (!res.ok) throw new Error('Invalid ZIP code');
  const data = await res.json();
  const place = data.places[0];
  return {
    city: place['place name'],
    stateAbbr: place['state abbreviation'],
    stateName: STATE_ABBR[place['state abbreviation']] || place.state,
    lat: parseFloat(place.latitude),
    lon: parseFloat(place.longitude),
  };
}

// Reverse geocode lat/lon → county name via FCC Census Block API
const COUNTY_ALIASES = {
  'New York': 'Manhattan', 'Kings': 'Brooklyn', 'Queens': 'Queens',
  'Richmond': 'Staten Island', 'St Louis': 'St. Louis',
};
async function lookupCounty(lat, lon) {
  const res = await fetch(`https://geo.fcc.gov/api/census/block/find?latitude=${lat}&longitude=${lon}&format=json`);
  if (!res.ok) return null;
  const data = await res.json();
  if (data.status !== 'OK' || !data.County) return null;
  // Strip suffixes: "Worcester County" → "Worcester", "Orleans Parish" → "Orleans"
  const raw = data.County.name.replace(/\s+(County|Parish|Borough|Census Area|Municipality|city)$/i, '').trim();
  return COUNTY_ALIASES[raw] || raw;
}

