// Fetch electricity price from EIA (monthly, state-level, cents/kWh)
async function fetchElecPrice(stateAbbr, apiKey) {
  const url = `https://api.eia.gov/v2/electricity/retail-sales/data/?api_key=${apiKey}&frequency=monthly&data[0]=price&facets[sectorid][]=RES&facets[stateid][]=${stateAbbr}&sort[0][column]=period&sort[0][direction]=desc&length=1`;
  const res = await fetch(url);
  if (!res.ok) throw new Error('EIA electricity API error');
  const data = await res.json();
  const row = data?.response?.data?.[0];
  if (!row?.price) throw new Error('No electricity price data');
  return { price: row.price / 100, period: row.period, unit: '$/kWh' }; // cents→dollars
}

// Fetch fuel prices from EIA SEDS (annual, state-level, $/MMBTU)
async function fetchFuelPrices(stateAbbr, apiKey) {
  const fuels = [
    { id: 'NGRCD', name: 'gas', convFactor: 0.1, unit: '$/therm' },
    { id: 'DFRCD', name: 'oil', convFactor: 0.1385, unit: '$/gal' },
    { id: 'PQRCD', name: 'propane', convFactor: 0.0915, unit: '$/gal' },
  ];
  const results = {};
  for (const fuel of fuels) {
    try {
      const url = `https://api.eia.gov/v2/seds/data/?api_key=${apiKey}&frequency=annual&data[0]=value&facets[seriesId][]=${fuel.id}&facets[stateId][]=${stateAbbr}&sort[0][column]=period&sort[0][direction]=desc&length=1`;
      const res = await fetch(url);
      if (!res.ok) continue;
      const data = await res.json();
      const row = data?.response?.data?.[0];
      if (row?.value) {
        results[fuel.name] = {
          price: row.value * fuel.convFactor,
          rawMMBTU: row.value,
          period: row.period,
          unit: fuel.unit,
        };
      }
    } catch (e) { /* skip failed fuel */ }
  }
  return results;
}

// Fetch 3-year historical weather from Open-Meteo → HDD + design temp
async function fetchClimateData(lat, lon) {
  const endYear = new Date().getFullYear() - 1;
  const startYear = endYear - 2;
  const url = `https://archive-api.open-meteo.com/v1/archive?latitude=${lat}&longitude=${lon}&start_date=${startYear}-01-01&end_date=${endYear}-12-31&daily=temperature_2m_min,temperature_2m_max,temperature_2m_mean&temperature_unit=fahrenheit&timezone=America%2FNew_York`;
  const res = await fetch(url);
  if (!res.ok) throw new Error('Open-Meteo API error');
  const data = await res.json();
  const means = data.daily.temperature_2m_mean.filter(v => v !== null);
  const mins = data.daily.temperature_2m_min.filter(v => v !== null);
  
  // Calculate HDD (base 65°F), averaged over the period
  const totalDays = means.length;
  const years = totalDays / 365.25;
  const totalHDD = means.reduce((sum, t) => sum + Math.max(0, 65 - t), 0);
  const annualHDD = Math.round(totalHDD / years);
  
  // Calculate CDD (base 65°F)
  const totalCDD = means.reduce((sum, t) => sum + Math.max(0, t - 65), 0);
  const annualCDD = Math.round(totalCDD / years);
  
  // Design temperatures
  const sortedMins = [...mins].sort((a, b) => a - b);
  const idx99_6 = Math.floor(sortedMins.length * 0.004);
  const idx99 = Math.floor(sortedMins.length * 0.01);
  const designTemp99_6 = Math.round(sortedMins[idx99_6] * 10) / 10;
  const designTemp99 = Math.round(sortedMins[idx99] * 10) / 10;
  const absMin = Math.round(sortedMins[0] * 10) / 10;
  const annualAvg = Math.round((means.reduce((s, v) => s + v, 0) / means.length) * 10) / 10;
  
  // Determine IECC climate zone (simplified)
  let cz = '4A';
  if (annualHDD >= 12600) cz = '8';
  else if (annualHDD >= 9000) cz = '7';
  else if (annualHDD >= 7200) cz = '6A';
  else if (annualHDD >= 5400) cz = '5A';
  else if (annualHDD >= 3600) cz = '4A';
  else if (annualHDD >= 2400) cz = '3A';
  else if (annualHDD >= 1500) cz = '2A';
  else cz = '1A';

  // Cooling design temp (99th percentile of maxes)
  const maxes = data.daily.temperature_2m_max.filter(v => v !== null);
  const sortedMaxes = [...maxes].sort((a, b) => b - a);
  const coolDesignIdx = Math.floor(sortedMaxes.length * 0.01);
  const coolingDesign = Math.round(sortedMaxes[coolDesignIdx]);

  return {
    hdd: annualHDD,
    cdd: annualCDD,
    designTemp: Math.round(designTemp99),
    coolingDesign,
    designTemp99_6,
    designTemp99,
    absMin,
    annualAvg,
    climateZone: cz,
    dataYears: `${startYear}-${endYear}`,
    daysAnalyzed: totalDays,
  };
}

