// CALCULATION FUNCTIONS
// ═══════════════════════════════════════════════════════
// ═══════════════════════════════════════════════════════
// CALCULATION ENGINE — ASHRAE/Manual-J Aligned
// ═══════════════════════════════════════════════════════
// Window area = gross wall area × WWR (ACCA Manual J / ASHRAE Ch.18)
// Infiltration: sensible = V × ACHn × 0.018 × ΔT
// Internal gains credit: 1,200 BTU/hr (Manual J Table 4)
// Duct multiplier: distribution system losses

// Envelope option lookups
const WIN_U = {"Single Pane (U-1.04)":1.04,"Single + Storm (U-0.56)":0.56,"Double Clear (U-0.49)":0.49,"Double Low-E (U-0.30)":0.30,"Triple Low-E (U-0.20)":0.20,"Triple Low-E Argon (U-0.17)":0.17};
const ATT_R = {"Uninsulated (R-5)":5,'R-11 (3.5" batts)':11,'R-19 (6" batts)':19,'R-30 (10" batts)':30,'R-38 (12" blown)':38,'R-49 (16" blown)':49,'R-60 (20" blown)':60};
const WALL_R = {"Uninsulated 2x4 (R-4)":4,"2x4 Partial Fill (R-7)":7,"2x4 R-11 Batts (R-10)":10,"2x4 R-13 Batts (R-11.5)":11.5,'2x4 R-15 + 1" CI (R-16)':16,"2x6 R-19 Batts (R-16)":16,"2x6 R-21 Batts (R-18)":18,"2x6 + CI (R-25)":25};
const FLR_R = {"Uninsulated (R-3)":3,"Minimal (R-7)":7,"R-11 Batts":11,"R-19 Batts":19,"R-25 Batts":25,"R-30 Batts + Foam":30,"R-38 Full Encap":38};
const WWR_V = {"Low (12%)":0.12,"Typical (18%)":0.18,"Average (22%)":0.22,"Above Avg (28%)":0.28,"High (35%)":0.35};
const ACH_V = {"Very Tight (0.05)":0.05,"Tight (0.15)":0.15,"Good (0.25)":0.25,"Average (0.40)":0.40,"Leaky (0.60)":0.60,"Very Leaky (1.0)":1.0};
const DUCT_V = {"No Ducts":1.0,"Ducts in Conditioned":1.0,"Sealed in Attic/Crawl":1.10,"Typical in Attic/Crawl":1.20,"Leaky Unconditioned":1.30};

const calcLoad = (area, floors, ceil, wwrSel, achSel, winSel, attSel, wallSel, flrSel, ductSel, dT, groundTemp) => {
  const deltaT = 70 - dT;
  if (deltaT <= 0) return { total:0, inf:0, win:0, att:0, wal:0, flo:0, btuDeg:0, gross:0, intGains:0, ductMult:1 };
  // Floor losses are to ground, not outdoor air
  const deltaTFloor = Math.max(0, 70 - (groundTemp || 50));
  const vol = area * ceil;
  const floorArea = area / floors;
  const peri = Math.sqrt(floorArea) * 4;
  const grossWall = peri * ceil * floors;
  const wwr = WWR_V[wwrSel] || 0.18;
  const winArea = grossWall * wwr;  // ASHRAE: windows from wall area
  const netWall = grossWall - winArea;
  const winU = WIN_U[winSel] || 0.49;
  const attR = ATT_R[attSel] || 19;
  const wallR = WALL_R[wallSel] || 11.5;
  const flrR = FLR_R[flrSel] || 11;
  const ach = ACH_V[achSel] || 0.40;
  const ductMult = DUCT_V[ductSel] || 1.0;
  const inf = vol * ach * 0.018 * deltaT;
  const win = winArea * winU * deltaT;
  const att = floorArea * (1 / attR) * deltaT;
  const wal = netWall * (1 / wallR) * deltaT;
  const flo = floorArea * (1 / flrR) * deltaTFloor; // ground ΔT, not air ΔT
  const envelope = inf + win + att + wal + flo;
  const intGains = 1200;
  const subtotal = Math.max(0, envelope - intGains);
  const total = subtotal * ductMult;
  return { total:Math.round(total), gross:Math.round(envelope), inf:Math.round(inf), win:Math.round(win), att:Math.round(att), wal:Math.round(wal), flo:Math.round(flo), intGains, ductMult, btuDeg: deltaT > 0 ? Math.round(total / deltaT) : 0 };
};

const calcSCOP = (hp, designTemp) => {
  const bins = [{ t: -15, h: 0.01 }, { t: -10, h: 0.03 }, { t: -5, h: 0.04 }, { t: 0, h: 0.06 }, { t: 5, h: 0.08 }, { t: 10, h: 0.12 }, { t: 15, h: 0.14 }, { t: 20, h: 0.16 }, { t: 25, h: 0.14 }, { t: 30, h: 0.10 }, { t: 35, h: 0.06 }, { t: 40, h: 0.04 }, { t: 47, h: 0.02 }];
  const getCOP = t => {
    if (t <= 5) return hp.cop5 || hp.cop17 * 0.82;
    if (t <= 17) return hp.cop5 + (hp.cop17 - hp.cop5) * (t - 5) / 12;
    if (t <= 47) return hp.cop17 + (hp.cop47 - hp.cop17) * (t - 17) / 30;
    return hp.cop47;
  };
  let wCOP = 0, wTotal = 0;
  bins.forEach(b => { if (b.t <= 65) { wCOP += getCOP(b.t) * b.h; wTotal += b.h; } });
  return wTotal > 0 ? wCOP / wTotal : 2.5;
};

const calcCost = (load, hdd, fuel, hp, eff) => {
  const annual = load.btuDeg * hdd * 24;
  const scop = calcSCOP(hp);
  const kwh = annual / (scop * 3412);
  const hpCost = kwh * fuel.e;
  const gasTh = annual / (100000 * (eff.gas / 100));
  const oilGal = annual / (138500 * (eff.oil / 100));
  const propGal = annual / (91500 * (eff.prop / 100));
  const resistKwh = annual / 3412;
  const resistCost = resistKwh * fuel.e;
  return {
    hp: { cost: Math.round(hpCost), kwh: Math.round(kwh), scop },
    gas: { cost: Math.round(gasTh * fuel.g), therms: Math.round(gasTh) },
    oil: { cost: Math.round(oilGal * fuel.o), gallons: Math.round(oilGal) },
    prop: { cost: Math.round(propGal * fuel.p), gallons: Math.round(propGal) },
    resist: { cost: Math.round(resistCost), kwh: Math.round(resistKwh) },
    annualMMBTU: annual / 1000000
  };
};

const getCapAt = (hp, t) => {
  if (t <= 5) return hp.mc5 || hp.mc17 * 0.7;
  if (t <= 17) return (hp.mc5 || hp.mc17 * 0.7) + (hp.mc17 - (hp.mc5 || hp.mc17 * 0.7)) * (t - 5) / 12;
  if (t <= 47) return hp.mc17 + (hp.mc47 - hp.mc17) * (t - 17) / 30;
  return hp.mc47;
};

// COP at any outdoor temp (continuous interpolation)
const getCOPAtTemp = (hp, t) => {
  if (!hp) return 1;
  if (t <= 5) return hp.cop5 || hp.cop17 * 0.82;
  if (t <= 17) return (hp.cop5 || hp.cop17 * 0.82) + (hp.cop17 - (hp.cop5 || hp.cop17 * 0.82)) * (t - 5) / 12;
  if (t <= 47) return hp.cop17 + (hp.cop47 - hp.cop17) * (t - 17) / 30;
  return hp.cop47;
};

// Temperature bin hours — parametric estimate from HDD & design temp
const estimateBinHours = (hdd, designTemp) => {
  const bins = [
    { label: '-40 to -30', mid: -35 }, { label: '-30 to -20', mid: -25 },
    { label: '-20 to -10', mid: -15 }, { label: '-10 to 0', mid: -5 },
    { label: '0 to 10', mid: 5 }, { label: '10 to 20', mid: 15 },
    { label: '20 to 30', mid: 25 }, { label: '30 to 40', mid: 35 },
    { label: '40 to 50', mid: 45 }, { label: '50 to 60', mid: 55 },
  ];
  const meanT = Math.max(-10, Math.min(60, 65 - hdd / 365));
  const sigma = 18;
  const totalHours = Math.min(7000, Math.round(hdd * 0.72));
  let raw = bins.map(b => ({ ...b, rawWeight: b.mid >= 65 ? 0 : Math.exp(-0.5 * ((b.mid - meanT) / sigma) ** 2) }));
  raw = raw.map(b => ({ ...b, rawWeight: b.mid < designTemp - 15 ? 0 : b.rawWeight }));
  const sum = raw.reduce((s, b) => s + b.rawWeight, 0);
  return raw.map(b => ({ ...b, hours: sum > 0 ? Math.round(b.rawWeight / sum * totalHours) : 0 }));
};

// ═══ ADJUSTED MODEL ═══
// Back-calculate heating load from historical fuel usage in native units
// usage = annual consumption in native units (therms for gas, gallons for oil/propane)
// fuelType: 'gas'|'oil'|'propane'
const FUEL_BTU_PER_UNIT = { gas: 100000, oil: 138500, propane: 91500 }; // BTU per therm/gallon
const FUEL_UNIT_LABEL = { gas: 'therms', oil: 'gallons', propane: 'gallons' };
const FUEL_UNIT_DEFAULT = { gas: 800, oil: 600, propane: 600 };
const FUEL_UNIT_STEP = { gas: 25, oil: 25, propane: 25 };
// Typical annual DHW usage in native units (for homes with 2-3 occupants)
const DHW_USAGE = { gas: 200, oil: 130, propane: 150 }; // therms or gallons/yr

const calcAdjustedLoad = (usage, hdd, fuelType, eff, includeDHW) => {
  if (!usage || usage <= 0 || hdd <= 0) return null;
  const btuPerUnit = FUEL_BTU_PER_UNIT[fuelType] || 100000;
  const effMap = { gas: eff.gas, oil: eff.oil, propane: eff.prop };
  const efficiency = (effMap[fuelType] || 85) / 100;
  // If DHW is on the same fuel, subtract estimated DHW usage before back-calc
  const heatingUsage = includeDHW ? Math.max(0, usage - (DHW_USAGE[fuelType] || 0)) : usage;
  const annualBTU = heatingUsage * btuPerUnit * efficiency;
  const btuDeg = Math.round(annualBTU / (hdd * 24));
  return btuDeg;
};

// ═══ COOLING LOAD ═══
// Sensible Heat Ratio: fraction of total cooling that is sensible (remainder is latent/moisture)
// Humid climates need more latent removal; dry climates are almost all sensible
const estimateSHR = (cdd) => {
  if (cdd >= 2500) return 0.70; // hot-humid (Gulf Coast, SE)
  if (cdd >= 1500) return 0.75; // mixed-humid (Mid-Atlantic, Midwest)
  if (cdd >= 800)  return 0.80; // cool-humid (New England, PNW)
  return 0.85;                   // dry / minimal cooling
};

// Peak sensible cooling load at design conditions (envelope-based)
const calcCoolingLoad = (btuDeg, coolingDesignTemp, indoorTemp = 75) => {
  const dT = Math.max(0, coolingDesignTemp - indoorTemp);
  return Math.round(btuDeg * dT * 0.85);
};

// Full cooling breakdown: sensible + latent = total
const calcCoolingBreakdown = (btuDeg, coolingDesignTemp, cdd, indoorTemp = 75) => {
  const sensible = calcCoolingLoad(btuDeg, coolingDesignTemp, indoorTemp);
  const shr = estimateSHR(cdd || 0);
  const total = shr > 0 ? Math.round(sensible / shr) : sensible;
  const latent = total - sensible;
  return { sensible, latent, total, shr };
};

// Realistic cooling load at a given outdoor temp — includes solar, internal gains, and latent
// At mild temps (82°F), envelope load is tiny but solar/internal/latent are still significant
// This drives the dehumidification assessment: can the HP modulate below this load?
const calcCoolingLoadAtTemp = (btuDeg, outdoorTemp, area, coolingDesignTemp, indoorTemp = 75) => {
  const dT = Math.max(0, outdoorTemp - indoorTemp);
  const envelope = btuDeg * dT * 0.85; // sensible envelope
  const solarInternal = area * 2.0;    // ~2 BTU/hr/sf for solar + occupant + equipment gains
  const peakLoad = calcCoolingLoad(btuDeg, coolingDesignTemp, indoorTemp);
  // At partial load, floor at ~40% of peak (solar/internal persist even on mild days)
  return Math.round(Math.max(peakLoad * 0.40, envelope + solarInternal));
};

// ═══ COMPREHENSIVE HP ANALYSIS ═══
// Returns sizing flags, cycling penalty, resistance %, true SCOP, cooling emoji
const analyzeHP = (hp, loadObj, hdd, designTemp, coolingDesignTemp, cdd, area) => {
  if (!hp || !loadObj || !loadObj.btuDeg) return null;
  const btuDeg = loadObj.btuDeg;
  const totalLoad = loadObj.total;

  // === SIZING FLAGS ===
  const capAtDesign = getCapAt(hp, designTemp);
  const sizingPct = totalLoad > 0 ? Math.round((capAtDesign / totalLoad) * 100) : 0;
  let sizingFlag = 'good';
  if (sizingPct > 140) sizingFlag = 'oversized';
  else if (sizingPct > 125) sizingFlag = 'slightly_over';
  else if (sizingPct < 70) sizingFlag = 'undersized';
  else if (sizingPct < 85) sizingFlag = 'slightly_under';

  // === BIN ANALYSIS: Cycling, Resistance, True SCOP ===
  const bins = estimateBinHours(hdd, designTemp);
  let totalHeatBTU = 0;
  let totalElecBTU = 0; // electrical input BTU (= kWh × 3412)
  let totalResistBTU = 0; // heating BTU from resistance
  let totalResistElecBTU = 0; // electrical BTU for resistance
  let totalCyclingPenaltyKWH = 0;
  let binDetails = [];

  bins.filter(b => b.hours > 0).forEach(bin => {
    const dT = Math.max(0, 70 - bin.mid);
    const loadAtBin = btuDeg * dT;
    const heatBTU = loadAtBin * bin.hours;
    if (heatBTU <= 0) return;

    const hpCap = getCapAt(hp, bin.mid);
    const hpCOP = (bin.mid >= hp.lt) ? getCOPAtTemp(hp, bin.mid) : 1.0; // Fallback COP=1 below rated temp
    const canMeet = bin.mid >= hp.lt;

    // How much can the HP handle?
    let hpBTU, resistBTU;
    if (!canMeet) {
      // Below rated temp: all resistance
      hpBTU = 0;
      resistBTU = heatBTU;
    } else if (hpCap >= loadAtBin) {
      // HP covers full load
      hpBTU = heatBTU;
      resistBTU = 0;
    } else {
      // HP covers what it can, resistance covers the rest
      const hpFraction = hpCap / loadAtBin;
      hpBTU = heatBTU * hpFraction;
      resistBTU = heatBTU * (1 - hpFraction);
    }

    // Electrical input
    const hpElecBTU = hpCOP > 0 ? hpBTU / hpCOP : 0;
    const resistElecBTU = resistBTU; // COP = 1

    // Cycling penalty: if HP capacity > 1.4× load at bin, apply 20% penalty
    let cyclingPenalty = 0;
    if (canMeet && hpCap > loadAtBin * 1.4 && loadAtBin > 0) {
      cyclingPenalty = (hpElecBTU / 3412) * 0.20; // 20% of HP kWh
    }

    totalHeatBTU += heatBTU;
    totalElecBTU += hpElecBTU + resistElecBTU;
    totalResistBTU += resistBTU;
    totalResistElecBTU += resistElecBTU;
    totalCyclingPenaltyKWH += cyclingPenalty;

    binDetails.push({
      label: bin.label, mid: bin.mid, hours: bin.hours,
      loadBTU: heatBTU, hpBTU, resistBTU,
      resistPct: heatBTU > 0 ? Math.round((resistBTU / heatBTU) * 100) : 0,
      cycling: canMeet && hpCap > loadAtBin * 1.4,
    });
  });

  // True SCOP (includes resistance + cycling penalty)
  const totalKWH = (totalElecBTU / 3412) + totalCyclingPenaltyKWH;
  const trueSCOP = totalKWH > 0 ? totalHeatBTU / (totalKWH * 3412) : 0;
  const resistPctTotal = totalHeatBTU > 0 ? Math.round((totalResistBTU / totalHeatBTU) * 100) : 0;
  const cyclingPenaltyPct = totalKWH > 0 ? Math.round((totalCyclingPenaltyKWH / totalKWH) * 100) : 0;

  // === COOLING / DEHUMIDIFICATION ANALYSIS ===
  // Peak cooling capacity check (design day)
  const coolingLoadPeak = calcCoolingLoad(btuDeg, coolingDesignTemp);
  const coolingCap = hp.c95 || hp.mc47 || 0; // Max cooling capacity @ 95°F
  const coolingRatioPeak = coolingLoadPeak > 0 ? coolingCap / coolingLoadPeak : 0;

  // Dehumidification: can the HP ramp down at mild conditions (82°F)?
  // Realistic 82°F load includes solar, internal gains, and latent — much more than just envelope
  const coolingLoad82 = calcCoolingLoadAtTemp(btuDeg, 82, area || 2000, coolingDesignTemp);
  const minCool82 = hp.nc82 || 0; // Min cooling capacity @ 82°F
  const dehumidRatio = coolingLoad82 > 0 ? minCool82 / coolingLoad82 : 99;
  // dehumidRatio < 0.7 → excellent: HP runs long cycles, great moisture removal
  // dehumidRatio 0.7–1.0 → good: HP mostly keeps up
  // dehumidRatio 1.0–1.5 → fair: some short cycling at mild temps
  // dehumidRatio > 1.5 → poor: can't modulate low enough, humidity problems
  let dehumidFlag = 'good', dehumidEmoji = '😊';
  if (dehumidRatio > 2.0) { dehumidFlag = 'poor'; dehumidEmoji = '🤢'; }
  else if (dehumidRatio > 1.25) { dehumidFlag = 'fair'; dehumidEmoji = '😟'; }
  else if (dehumidRatio > 0.75) { dehumidFlag = 'good'; dehumidEmoji = '😊'; }
  else { dehumidFlag = 'excellent'; dehumidEmoji = '🌟'; }

  // Overall cooling emoji: worst of peak sizing + dehumid
  let coolingEmoji = dehumidEmoji;
  if (coolingRatioPeak > 2.0) coolingEmoji = '🤢'; // grossly oversized even at peak
  else if (coolingRatioPeak < 0.7) coolingEmoji = '😟'; // undersized at peak

  // === ECONOMIC BALANCE POINT (vs natural gas) ===
  // Temperature where HP $/BTU = gas $/BTU
  // This is computed in the chart data, not here

  return {
    sizingPct, sizingFlag, capAtDesign,
    trueSCOP: Math.round(trueSCOP * 100) / 100,
    resistPctTotal, cyclingPenaltyPct,
    totalResistKWH: Math.round(totalResistElecBTU / 3412),
    totalCyclingKWH: Math.round(totalCyclingPenaltyKWH),
    totalKWH: Math.round(totalKWH),
    coolingLoad: coolingLoadPeak, coolingCap, coolingRatio: Math.round(coolingRatioPeak * 100), coolingEmoji,
    coolingLoad82, minCool82, dehumidRatio: Math.round(dehumidRatio * 100), dehumidFlag, dehumidEmoji,
    binDetails,
  };
};

// Pie chart constants
const PIE_COLORS = ['#3b82f6','#64748b','#eab308','#f97316','#22c55e'];
const renderPieLabel = ({ cx, cy, midAngle, outerRadius, value }) => {
  const RADIAN = Math.PI / 180;
  const radius = outerRadius + 28;
  const x = cx + radius * Math.cos(-midAngle * RADIAN);
  const y = cy + radius * Math.sin(-midAngle * RADIAN);
  return <text x={x} y={y} fill="#cbd5e1" textAnchor={x > cx ? 'start' : 'end'} dominantBaseline="central" fontSize={11} fontWeight={600}>{value.toLocaleString()}</text>;
};

