  const [ductSel, setDuctSel] = useState("No Ducts");

  // Load model selection: 'asset' | 'occupancy' | 'manualj'
  const [loadModel, setLoadModel] = useState('asset');
  const [manualJLoad, setManualJLoad] = useState(0); // BTU/hr from professional Manual J
  const [historicalUsage, setHistoricalUsage] = useState(800);
  const [historicalFuel, setHistoricalFuel] = useState('gas'); // gas|oil|propane
  const [dhwIncluded, setDhwIncluded] = useState(true); // same fuel used for DHW?

  // Second HP for comparison
  const [selHP2, setSelHP2] = useState(null);

